package com.passion.eclass303.snsboard;

public class SNSStartEnd {

	private int start;
	private int end;
	private String snsSearch;

	public SNSStartEnd() {
		// TODO Auto-generated constructor stub
	}

	public SNSStartEnd(int start, int end, String snsSearch) {
		super();
		this.start = start;
		this.end = end;
		this.snsSearch = snsSearch;
	}

	public int getStart() {
		return start;
	}

	public void setStart(int start) {
		this.start = start;
	}

	public int getEnd() {
		return end;
	}

	public void setEnd(int end) {
		this.end = end;
	}

	public String getSnsSearch() {
		return snsSearch;
	}

	public void setSnsSearch(String snsSearch) {
		this.snsSearch = snsSearch;
	}
	
	

}
